column26:
2021-11-29, IhsanAS: Unfortunately, In T-2 both accessions of Asperuginoides were in positions unrelated to the Alysseae, of which one (SRR8528395) fell in a useless clade consisting Zerdana (now Sterigmostemum) and Microstigma of Anchonieae, Kremeriella (Brassiceae) sister to Asperuginoides. The other accession (RMNH) was sister to the Hillielleae. Both of these accessions were probably the result of experimental errors. 
Asperuginoides was unassigned to tribe by Al-Shehbaz (2012), excluded from the Alysseae by _paniel et al. (2015), and showed affinity to the Cochleariereae by Walden et al. (2020). In my opinion, it merits the recognition as the new unigeneric tribe Asperuginoideae;
2021-12-03, KasperH: Given the "correct" position of the sample in the nuclear phylogeny, I tend to think we should keep this chloroplast data also and see what happens to its position in a follow-up phylogeny, one from which many poor samples have been removed first.

column23:
2021-11-29, IhsanAS: Brassica nigra (n=8) definitely belongs to a different genus, and I exclude it from that genus. It is sister to Sinapis alba (type; n=12), which may suggest that they belong to the same genus. However, in all previous molecular studies, it does not, and it is much more closely related to Rhamphospermum arvense (previously S. arvensis; n=9), where I currently place it;
2021-12-04, IhsanAS: There are three plants of two species in this image [on BioPortal]. The two on the left are 100% Sinapis alba; the one on the right was Sinapis arvensis but now Rhamphospermum arvense;
2021-12-06, KasperH: Because this sample forms a clade with S0644, which is S. alba, I'll assign it to that species also. However, I have not checked from where I took the leaf when subsampling.)

