column23:
2021-11-29, Ihsan AS: A big surprise is the inclusion of the previously unplaced European Fourraea alpina in this complex, and it makes more sense to include it in the Isatideae, as suggested in Tree-2; 
2021-12-02: KasperH: include it in following analyses, and might show in more expected position after poor samples have been pruned;
2021-11-29, IhsanAS: The Thelypodieae plus Fourraea form a sister clade to the Isatideae. Schrenkiella forms a strongly supported clade sister to a larger clade containing Isatideae, Thelypodieae plus Sisymbrieae, and Brassiceae. In summary, both Fourraea and Schrenkiella are affiliated with a complex including Isatidae plus Thelypodieae.  
2022-02-04, IhsanAS: "a new tribal name needs to be proposed for Fourraea alpina "

column26:
2021-11-29, IhsanAS: The position of Pugionium between Anastatica and the rest of Anastaticeae in both trees is surprising and very odd (see below);
2021-11-26, DmitryG: position within Anastaticeae is likely wrong;
2021-12-03, KasperH: May seem weird, but the nuclear DNA groups the sample with another member from the same tribe, suggesting the sample and DNA library could be trusted...
2021-12-04, IhsanAS: Pugionium is correctly with Megacarpaea in T-1, but it is erroneously with Anastatica in T-2. It is the same Pugionium accession listed once in each tree, not twice in T-2. My concern is the erroneous position of Pugionium nested within the Anastaticeae in T-2.
